1. Install dependencies

bash


npm install ai openai @picahq/ai
2. Create API route

typescript


import { openai } from "@ai-sdk/openai";
import { convertToCoreMessages, streamText } from "ai";
import { Pica } from "@picahq/ai";

export async function POST(request: Request) {
  const { messages } = await request.json();

  const pica = new Pica(process.env.PICA_SECRET_KEY as string);

  const systemPrompt = await pica.generateSystemPrompt();

  const stream = streamText({
    model: openai("gpt-4o"),
    system: systemPrompt,
    tools: { ...pica.oneTool },
    messages: convertToCoreMessages(messages),
    maxSteps: 5,
  });

  return (await stream).toDataStreamResponse();
}
3. Test the endpoint

bash


curl --location 'http://localhost:3001/api/ai' \
--header 'Content-Type: application/json' \
--data '{
    "messages": [{"role": "user", "content": "What connections do I have access to?"}]
}'
